import React from "react";
import Product from './../components/Product'

const CataloguePage = () => {
    return(
    <div className="row">
        <div className="fields">
            {
            this.state.photos
                .map(photo=> 
                    <Product {...photo} />
                )
            }
        </div>
    </div>
    )
}

export default CataloguePage;
